syntax = "proto3";

package recipes.recipe_engine.engine_tests.proto_output_properties;

message Output {
  string str = 1;
  repeated string strs = 2;
  Msg msg = 3;
}

message Msg {
  int32 num = 1;
  repeated int32 nums = 2;
}
